/* {{{ PHP_MSHUTDOWN_FUNCTION
 */
PHP_MSHUTDOWN_FUNCTION(localeconv) {
  tsrm_mutex_free(locale_mutex);
  locale_mutex = NULL;
  return SUCCESS;
}
